      out.write("\t\t<div id=\"folddiv2\" style=\"padding:20px;display:none\">\r\n");
      out.write("\t\t\t\t<h3>1. 개인정보 처리방침이란?</h3><br>\r\n");
      out.write("\t\t\t\t주식회사 Ogu()이하\"회사\")는 이용자의 ‘동의를 기반으로 개인정보를 수집·이용 및 제공’하고 있으며, ‘이용자의 권리 (개인정보 자기결정권)를 적극적으로 보장’합니다.<br>\r\n");
      out.write("\t\t\t\t회사는 정보통신서비스제공자가 준수하여야 하는 대한민국의 관계 법령 및 개인정보보호 규정, 가이드라인을 준수하고 있습니다.<br>\r\n");
      out.write("\t\t\t\t“개인정보처리방침”이란 이용자의 소중한 개인정보를 보호함으로써 이용자가 안심하고 서비스를 이용할 수 있도록 회사가 준수해야 할 지침을 의미합니다.<br>\r\n");
      out.write("\t\t\t\t본 개인정보처리방침은 회사가 제공하는 Ogu계정 기반의 서비스(이하 ‘서비스'라 함)에 적용됩니다.<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t<h3>2. 개인정보 수집</h3><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t서비스 제공을 위한 필요 최소한의 개인정보를 수집하고 있습니다.<br>\r\n");
      out.write("\t\t\t\t회원 가입 시 또는 서비스 이용 과정에서 홈페이지 또는 개별 어플리케이션이나 프로그램 등을 통해 아래와 같은 서비스 제공을 위해 필요한 최소한의 개인정보를 수집하고 있습니다.<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t[오구계정]<br><br>\r\n");
      out.write("\t\t\t\t<b>필수</b><br>\r\n");
      out.write("\t\t\t\t이메일, 비밀번호, 이름(닉네임), 프로필사진, 서비스 이용내역, 서비스 내 구매 및 결제 내역<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t[유료서비스 이용 시]<br><br>\r\n");
      out.write("\t\t\t\t신용카드 : 카드번호(일부), 카드사명 등<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t[환불처리 시]<br><br>\r\n");
      out.write("\t\t\t\t계좌은행, 계좌번호, 예금주명, 이메일<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t<h3>3. 개인정보 이용</h3><br>\r\n");
      out.write("\t\t\t\t회원관리, 서비스 제공·개선, 신규 서비스 개발 등을 위해 이용합니다.<br>\r\n");
      out.write("\t\t\t\t회원 가입 시 또는 서비스 이용 과정에서 홈페이지 또는 개별 어플리케이션이나 프로그램 등을 통해 아래와 같이 서비스 제공을 위해 필요한 최소한의 개인정보를 수집하고 있습니다.<br>\r\n");
      out.write("\t\t\t\t회원 식별/가입의사 확인, 본인/연령 확인, 부정이용 방지<br>\r\n");
      out.write("\t\t\t\t만 14세 미만 아동 개인정보 수집 시 법정 대리인 동의여부 확인, 법정 대리인 권리행사 시 본인 확인<br>\r\n");
      out.write("\t\t\t\t이용자간 메시지 전송, 친구등록 및 친구추천 기능의 제공<br>\r\n");
      out.write("\t\t\t\t친구에게 활동내역을 알리거나 이용자 검색, 등록 등의 기능 제공<br>\r\n");
      out.write("\t\t\t\t신규 서비스 개발, 다양한 서비스 제공, 문의사항 또는 불만처리, 공지사항 전달<br>\r\n");
      out.write("\t\t\t\t유료서비스 이용 시 컨텐츠 등의 전송이나 배송·요금 정산<br>\r\n");
      out.write("\t\t\t\t서비스의 원활한 운영에 지장을 주는 행위(계정 도용 및 부정 이용 행위 등 포함)에 대한 방지 및 제재<br>\r\n");
      out.write("\t\t\t\t인구통계학적 특성과 이용자의 관심, 기호, 성향의 추정을 통한 맞춤형 컨텐츠 추천 및 마케팅에 활용<br>\r\n");
      out.write("\t\t\t\t음성명령 처리 및 음성인식 향상, 개인화 서비스 제공<br>\r\n");
      out.write("\t\t\t\t서비스 이용 기록, 접속 빈도 및 서비스 이용에 대한 통계, 프라이버시 보호 측면의 서비스 환경 구축, 서비스 개선에 활용<br>\r\n");
