      out.write("\t\t\t<p style=\"float:right;\"><b style=\"float:right\">2020-11-08</b></p>\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\t\t<div id=\"folddiv3\" style=\"padding:20px;display:none\">\r\n");
      out.write("\t\t\t\t<h3>라이선스 및 사이트 및 서비스 액세스</h3>\r\n");
      out.write("\t\t\t\t사이트 및 서비스 내용은 사용자의 개인 사용을 위해 제공되며 상업적으로 이용할 수 없습니다.<br>\r\n");
      out.write("\t\t\t\t모든 뉴스 기사, 설명서, 오디오 클립 및 비디오 클립, 그래픽, 로고, 아이콘, 이미지 또는<br>\r\n");
      out.write("\t\t\t\t여기에 포함된 다운로드(또는 \"콘텐츠\")를 포함하며 이에 제한되지 않는 사이트에 게시된 모든 자료 또는<br>\r\n");
      out.write("\t\t\t\t정보는 저작권에 의해 보호되며 콘텐츠 제공자로 표시된 제삼자 또는 Ogu에 의해 소유 또는 제어됩니다.<br>\r\n");
      out.write("\t\t\t\t 사용자는 모든 콘텐츠에 포함된 모든 추가 저작권 공지, 정보 또는 제한 사항을 준수해야 합니다.<br>\r\n");
      out.write("\t\t\t\t 본 사이트 및 콘텐츠는 프랑스 및 국제 저작권법에 의해 보호됩니다.<br>\r\n");
      out.write("\t\t\t\t 사용자는 Ogu의 사전 서면 동의 없이는 본 콘텐츠 또는 사이트의 전체 또는 일부라도<br>\r\n");
      out.write("\t\t\t\t 수정, 게시, 전송, 전송 또는 판매 과정에 참여, 재생산(아래 단락에 제공된 경우는 예외), 파생 작업물 생성, 배포, 수행, 표시할 수 없습니다.<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t사용자는 여기에 포함된 모든 저작권 및 기타 공지를 준수하는 한 개인 또는 비상업적 용도로만 본 사이트에 표시된 콘텐츠 및 기타 다운로드 항목을 다운로드하거나 복사할 수 있습니다.<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t<h3>저작권, 상표권 및 지적 자산 권한</h3>\r\n");
      out.write("\t\t\t\t본 사이트 및/또는 서비스에 포함되었거나 본 사이트를 통해 제공되는 모든 콘텐츠는 Ogu 또는 해당 공급자의 자산이며,<br>\r\n");
      out.write("\t\t\t\t프랑스 및 국제 저작권법, 저작자 권한 및 데이터베이스 권한 법률에 의해 보호됩니다. 본 사이트에 포함되었거나 본 사이트를 통해 제공되는 그래픽,<br>\r\n");
      out.write("\t\t\t\t로고, 페이지 헤더, 단추 아이콘 및 제품 이름은 Ogu의 상표 또는 등록 상표입니다.<br>\r\n");
      out.write("\t\t\t\t본 사이트 및/또는 서비스에 표시되는 Ogu 소유 이외의 다른 모든 상표는 해당 소유자의 자산입니다.<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t귀하가 본 서비스를 통해 저장하거나 공유하는 귀하의 사용자 콘텐츠에 대한 모든 권한,<br>\r\n");
      out.write("\t\t\t\t소유권 및 이해 관계는 귀하에게 귀속됩니다.<br>\r\n");
      out.write("\t\t\t\t귀하가 개인정보 보호 설정에서 이 콘텐츠를 공유하도록 선택하는 경우에는,<br>\r\n");
      out.write("\t\t\t\t귀하가 본 서비스 제공과 관련하여 서비스 알고리즘 향상 및 학습을 위해 귀하의 사용자 콘텐츠를 복사,<br>\r\n");
      out.write("\t\t\t\t저장, 수정 및 사용할 수 있는 비배타적이고, 전 세계적이고, 로열티가 없고, 비용이 완전히 지급되었고,<br>\r\n");
      out.write("\t\t\t\t양도 가능하고, 서브라이센스가 가능하며, 영구적이고 취소할 수 없는 라이센스 권한을 Ogu에 부여하는 것으로 간주됩니다.<br>\r\n");
      out.write("\t\t\t\t동시에 사용자 콘텐츠와 관련된 분석 데이터를 제공하기 위해(예: 저장된 페이지 수)<br>\r\n");
      out.write("\t\t\t\t본사의 자동화된 시스템을 사용해서 귀하의 콘텐츠를 분석할 수 있는 권한을 Ogu에 부여하는 것으로 간주됩니다.<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t본사는 모든 사용자들이 다른 사람의 저작권 및 기타 지적 자산 권한을 준수한다고 가정합니다.<br>\r\n");
      out.write("\t\t\t\t사용자가 그러한 권한을 위반할 경우, Ogu는 고지 없이 위반 콘텐츠를 제거하거나 사용자 계정을 삭제할 수 있는 권한을 보유합니다.<br>\r\n");
      out.write("\t\t\t\t본사 서비스를 통해 사용자의 저작권 위반을 고지할 경우, ogu@ogu.com(으)로 연락하고 해당 위반 사례의 증거 및 설명을 제공하십시오.<br><br>\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t귀하가 고유 재량에 따라 본 사이트 및/또는 본 서비스의 기능 및 성능과 관련하여 Ogu에 피드백을 제공하는 경우(예: 잠재적인 오류 식별, 기능 개선 또는 향상 내용)(\"피드백\"),<br>\r\n");
      out.write("\t\t\t\t귀하에 대한 제한 또는 보상 없이 어떤 목적으로든 귀하의 피드백을 사용할 수 있는 권한이 Ogu에 부여됩니다.<br>\r\n");
      out.write("\t\t\t\tOgu에 피드백을 제공하고 싶은 경우, 이 피드백을 기밀로 유지해야 하며 제3자에게 알려주지 않아야 합니다.\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\t\r\n");
      out.write("\t\t<div class=\"supportcontent\">\r\n");
      out.write("\t\t\t<button disabled>입점안내</button>\r\n");
