      out.write("\t\t\t<p style=\"float:right;\"><b style=\"float:right\">2020-11-08</b></p>\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\t\t<div id=\"folddiv4\" style=\"padding:20px;display:none\">\r\n");
      out.write("\t\t\t<h3>상담 신청 및 입점 과정은 아래와 같이 진행됩니다.</h3><br><br>\r\n");
      out.write("\t\t\t<div style=\"padding:20px; width:50%; border-radius:6px; background: white\">\r\n");
      out.write("\t\t\t\t<img src=\"/store/image/icon/img_infodesk_inputgoods01.gif\" style=\"width:100%\"/>\r\n");
